# <xbar.desc>Shows open Freshesk tickets count</xbar.desc>

# Configurations
FRESHDESK_SUBDOMAIN = ""
FRESHDESK_API_KEY = ""

require 'net/http'
require 'json'
require 'date'

def fetch_tickets()
  uri = URI("https://#{FRESHDESK_SUBDOMAIN}.freshdesk.com/api/v2/tickets?filter=new_and_my_open")
  req = Net::HTTP::Get.new(uri)
  req.basic_auth FRESHDESK_API_KEY, 'x'
  res = Net::HTTP.start(uri.hostname, uri.port, use_ssl: true) { |http| http.request(req) }
  JSON.parse(res.body)
rescue
  []
end

def get_color(count)
  if count > 0
    return "color=red"
  end

  return ""
end

def get_image(count)

  if count > 0
    return ""
  end

  return ""
end

begin
  tickets = fetch_tickets

  count = 0

  if tickets.length > 0
    count = tickets.length
  end

  puts "#{tickets.length}" + " | " + get_color(count) + " " + get_image(count)

  puts "---"

  puts "View Tickets | href=https://#{FRESHDESK_SUBDOMAIN}.freshdesk.com/helpdesk/tickets"

rescue StandardError => msg
  puts 'Error occured, please refresh bitbar! >' + msg.to_s
end
